import React from 'react';
import { Link } from 'react-router-dom';

function Popup() {
  return (
    <div className="popup">
      <ul className="popup__list" style={{ listStyle: 'none' }}>
        <Link key={1} to="/login">
          Войти
        </Link>
        <br />
        <Link key={1} to="/registration">
          Регисрация
        </Link>
      </ul>
    </div>
  );
}

export default Popup;
